import React, { Component } from 'react'

class Footer extends Component {
    render() {
    return (
        <div className="footer">
        <div className='footer__navbar'>
            <a href='#'>HOME</a>
            <a href='#'>NEWS</a>
            <a href='#'>PRESS</a>
            <a href='#'>OUR GUESTS</a>
            <a href='#'>CAREERS</a>
            <a href='#'>FOLLOW US</a>
        </div>
        </div>
    )
  }
}
export default Footer
